const Details = () => {

    return(
        <div classname="main" >
          <br/>
          <br/>
          <br/>
          <br/>
          <Link to='/'>
          <h3>Go Back</h3></Link>
          <h1>Personal Details</h1>
        <div className="ui card centered">
        <div className="image">
            <img src={prof}/>
            <div className="content">
            <div className="header"><h2>Madan Mohan</h2></div>
            <div className="descriptuin"><p>how to define someting that indefinite</p></div>
        </div>
        </div>
        </div>


        </div>
    );
}


export default Details;
